  \"Oceanographic and surface meteorological data collected from station University
  of Michigan Marine Hydrodynamics Laboratories Bio Buoy by University of Michigan
  and assembled by Great Lakes Observing System (GLOS) in the Great Lakes region from
  2014-07-01 to 2015-06-30 (NCEI Accession 0123660)\",\n\t\"tracking_summary\": {\n\t\t\"total\":
  1,\n\t\t\"recent\": 1\n\t},\n\t\"groups\": [],\n\t\"relationships_as_subject\":
  [],\n\t\"revision_timestamp\": \"2016-02-26T22:16:01.043451\",\n\t\"name\": \"oceanographic-and-surface-meteorological-data-collected-from-station-university-of-michiga\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"NODC Accession 0123660 contains oceanographic
  and surface meteorological data in netCDF formatted files, which follow the Climate
  and Forecast metadata convention (CF) and the Attribute Convention for Data Discovery
  (ACDD). University of Michigan collected the data from their in-situ moored station
  named University of Michigan Marine Hydrodynamics Laboratories Bio Buoy in the Great
  Lakes. GLOS, which assembles data from University of Michigan and other sub-regional
  coastal and ocean observing systems of the Great Lakes region of the United States,
  submitted the data to NODC as part of NODC's Integrated Ocean Observing System Data
  Assembly Centers (IOOS DACs) Data Stewardship Program. Each month, NODC adds to
  the Accession the data collected during the previous month.\",\n\t\"license_title\":
